import React from 'react';
import { Link, withRouter } from 'react-router-dom';

function MovieList({ movies, match }) {
  console.log(movies);
  return (
    <ul>
      {movies.map(movie => (
        <li key={movie.id}>
          <Link to={`/movie/${movie.id}`}>
            <h4>{movie.title}</h4>
          </Link>
        </li>
      ))}
    </ul>
  );
}

export default withRouter(MovieList);
